export default (function(a,b,c,d,e,f){return {data:{d33W3EzJkR:{data:{id:503,attributes:{imdbId:"tt0088876",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BY2FmMGU1NDYtYjcyMy00MTI4LTg4OTktMGUwYmU1MDVhODViXkEyXkFqcGdeQXVyMDczMjgyNw@@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"6.7\u002F10"}],item_lang:{data:{id:1166,attributes:{title:d,plot:"Set in post-war (1949) rural New Zealand, this film traces the efforts of two con men to run a betting scam in a small town (Tainuea) already rife with illegal gambling corruption, and eccentricity.",slug:"came-a-hot-friday"}}},books:{data:[{id:3785,attributes:{title:d,description:"It was a Friday when Wes and Cyril came to town with a trick to play on the local bookmaker, but there was already other skullduggery afoot.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=sPFJAAAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:true,published:"1964-01-01",publisher:a,subtitle:a}},{id:3786,attributes:{title:d,description:"Wes and Cyril are two con-men who successfully cheat bookmakers in small towns throughout New Zealand. One Friday they came to town with a trick to play on the local bookmaker but there was already other skullduggery afoot.",thumbnail:a,authors:[b],firstBook:c,published:"2009-01-01",publisher:a,subtitle:a}},{id:3787,attributes:{title:"Pallet on the Floor",description:"Life was hard enough for Sam Jamieson without Jack Voot's lechery and Miriam Breen's jealousy. The life at Kurikino erupted into a sensation of murder and blackmail, turning into a nightmare from which the efforts of Tinny Entwistle, Gigglejuice Saunders and the Remittance Man could not save him. But Spud McGhee had an idea.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=1UonAAAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:c,published:e,publisher:a,subtitle:a}},{id:3788,attributes:{title:f,description:"The same week our fowls were stolen, Daphne Moran had her throat cut. Fourteen-year-old Neddy Poindexter and his mate Les take swift revenge on the chook-rustling Lynch Gang, but things turn sinister when vulture-like Hubert Salter stalks into Klynham. There’s a sex killer on the loose, and Neddy is in deep fear for the safety of his sister. In this lost masterpiece, first published in 1963, forgotten New Zealand writer Morrieson combines Boys’ Own adventure, psychological thriller, small-town saga and family farce to produce a brilliant, hallucinatory mixture distinctively his own.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=B-1evu0qSi4C&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:c,published:"2012-04-26",publisher:"Text Publishing",subtitle:"Text Classics"}},{id:3789,attributes:{title:f,description:"Fourteen-year-old Neddy Poindexter and his mate Les take swift revenge on the chook-rustling Lynch Gang, but things turn sinister when vulture-like Hubert Salter stalks into Klynham. There's a sex killer on the loose, and Neddy is in deep fear for the safety of his sister.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=DVonAAAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:c,published:e,publisher:a,subtitle:"A Novel"}}]}}},meta:{}}},prerenderedAt:1680940936149}}("","Ronald Hugh Morrieson",null,"Came a Hot Friday","1976-01-01","The Scarecrow"))